INSERT INTO `plant_info` VALUES (1,1,'상추 씨앗을 발아하기 전에는 씨앗을 얕게 심고 적절한 습도와 온도를 유지하여 발아 환경을 조성해야 합니다.',3,200,'아기 상추','나는 잎이 여리다추~!'),(1,2,'밝은 간접 조명 아래에서 성장하도록 배치하고, 토양이 적당히 습하도록 유지하며 과습을 피하고 통풍을 확보하여 건강한 성장을 도와주세요.',2,300,'청소년 상추','잎이 흩날릴만큼 자랐다추~!'),(1,3,' 충분한 일조와 적절한 관수로 생장을 유지하며, 필요에 따라 비료를 주기적으로 공급하여 건강하게 유지해주세요.',2,400,'어른 상추','나도 이제 아삭해졌다추~!'),(2,1,'장미가 발아하기 전에는 건조한 토양과 적절한 환기를 유지하며 실내 온도와 습도를 조절하여 씨앗을 기다리세요.',1,250,'아기 장미','혹시... 제가 도울 게 있을까요?'),(2,2,' 밝은 간접 조명 아래에서 키워주고, 적정한 습도와 통풍을 유지하여 건강한 성장을 도와주세요.',2,400,'청소년 장미','특별한 날을 도울 수 있다면 기뻐요...'),(2,3,'충분한 햇빛과 적절한 관수를 유지하며, 필요시 꽃을 꺽거나 시들은 잎이나 꽃을 제거하여 꽃의 생명력을 유지하고 길게 감상할 수 있도록 도와주세요.',3,500,'어른 장미','제가 함께 할테니, 걱정마세요.'),(3,1,'백도선이 발아하기 전에 건조한 토양과 적절한 환기를 유지하며 온도와 습도를 조절하여 씨앗을 준비하세요.',1,50,'아기 백도선','이 몸 등장이니라!!'),(3,2,'밝은 간접 조명 아래에서 키우며 적절한 습도와 통풍을 유지하여 건강한 성장을 도와주세요.',2,70,'청소년 백도선','이 몸에게 왕관이 생겼느니라!!'),(3,3,'밝은 조명과 일정한 관수를 유지하고, 환기를 시켜 실내 환경을 쾌적하게 유지하며, 필요시 비료를 주기적으로 공급하여 건강하게 유지해주세요.',3,100,'어른 백도선','이 몸을 황제선인장이라고 부르거라!!'),(4,1,'잘 키워 주세요23',1,110,'아기 바질','안녕하세요1'),(4,2,'잘 키워 주세요23',2,220,'청소년 바질','안녕하세요1'),(4,3,'잘 키웠다',3,330,'김장 배추','안녕히계세요1'),(5,1,'1',1,1,'아기 로즈마리','1'),(5,2,'1',1,1,'청소년 로즈마리','1'),(5,3,'1',1,1,'어른 로즈마리','1'),(6,1,'1',1,1,'아기 튤립','1'),(6,2,'2',1,1,'청소년 튤립','1'),(6,3,'1',1,1,'어른 튤립','1'),(7,1,'1',1,1,'아기 국화','1'),(7,2,'1',1,1,'청소년 국화','1'),(7,3,'1',1,1,'어른 국화','1'),(8,1,'1',1,1,'아기 하트호야','1'),(8,2,'1',1,1,'청소년 하트호야','1'),(8,3,'1',1,1,'어른 하트호야','1'),(9,1,'1',1,1,'아기 레지티아','1'),(9,2,'1',1,11,'청소년 레지티아','1'),(9,3,'1',1,1,'어른 레지티아','1');
